    /// <summary>
    /// Change the color of the pixel over which the mouse is if the drawing isn't finished
    /// </summary>
    void Update()
    {
        // Draw
        if (onPlay)
        {
            Vector2 pixel = new Vector2(((Input.mousePosition.x - image.rectTransform.position.x) + image.rectTransform.rect.width / 2) / 15.9f, ((Input.mousePosition.y - image.rectTransform.position.y) + image.rectTransform.rect.height / 2) / 15.9f);

            // Is the mouse over the image and not outside it's bounding
            if (Input.GetButton("Fire1") && pixel.x < 32 && pixel.x > 0 && pixel.y < 32 && pixel.y > 0)
            {
                drawing.SetPixel((int)pixel.x, (int)pixel.y, Color.black); // Set the pixel under the mouse black

                // If the pixels near this one aren't already colored, turn them gray
                if (drawing.GetPixel((int)pixel.x + 1, (int)pixel.y).grayscale != 0) { drawing.SetPixel((int)pixel.x + 1, (int)pixel.y, Color.gray); }
                if (drawing.GetPixel((int)pixel.x - 1, (int)pixel.y).grayscale != 0) { drawing.SetPixel((int)pixel.x - 1, (int)pixel.y, Color.gray); }
                if (drawing.GetPixel((int)pixel.x, (int)pixel.y + 1).grayscale != 0) { drawing.SetPixel((int)pixel.x, (int)pixel.y + 1, Color.gray); }
                if (drawing.GetPixel((int)pixel.x, (int)pixel.y - 1).grayscale != 0) { drawing.SetPixel((int)pixel.x, (int)pixel.y - 1, Color.gray); }

                // Apply the change to the texture
                drawing.Apply();
                image.texture = drawing;
            }
            if (Input.GetButton("Fire2") && pixel.x < 32 && pixel.x > 0 && pixel.y < 32 && pixel.y > 0)
            {
                drawing.SetPixel((int)pixel.x, (int)pixel.y, Color.white); // Set the pixel under the mouse white

                // If the pixels near this one aren't already white, turn them white
                if (drawing.GetPixel((int)pixel.x + 1, (int)pixel.y).grayscale != 1) { drawing.SetPixel((int)pixel.x + 1, (int)pixel.y, Color.white); }
                if (drawing.GetPixel((int)pixel.x - 1, (int)pixel.y).grayscale != 1) { drawing.SetPixel((int)pixel.x - 1, (int)pixel.y, Color.white); }
                if (drawing.GetPixel((int)pixel.x, (int)pixel.y + 1).grayscale != 1) { drawing.SetPixel((int)pixel.x, (int)pixel.y + 1, Color.white); }
                if (drawing.GetPixel((int)pixel.x, (int)pixel.y - 1).grayscale != 1) { drawing.SetPixel((int)pixel.x, (int)pixel.y - 1, Color.white); }

                // Apply the change to the texture
                drawing.Apply();
                image.texture = drawing;
            }
        }
    }


    /// <summary>
    /// Initialiaze a new white texture, the motif to draw, and call the train function
    /// </summary>
    public void StartGame()
    {
        guess.text = ""; // Reinitialiaze the guess

        // Reinitialiaze the texture
        drawing = new Texture2D(32, 32);
        for (int x = 0; x < 32; x++)
        {
            for (int y = 0; y < 32; y++)
            {
                drawing.SetPixel(x, y, Color.white);
            }
        }
        drawing.filterMode = FilterMode.Point;
        drawing.wrapMode = TextureWrapMode.Clamp;
        drawing.Apply();
        image.texture = drawing;

        // Reinitialiaze the motif to draw
        drawID = UnityEngine.Random.Range(0, 3);
        string toDraw = (drawID == 0) ? "A Cross" : (drawID == 1) ? "A Circle" : "A Triangle";
        title.text = "Draw ... " + toDraw + " !";

        // Call the train function to train 't' times
        int t = (int)Math.Pow(10, (int)trained.value);
        train(t);
    }

    /// <summary>
    /// Train the neural network by feedforwarding him 'times' times the three different form and backpropagating the correct answer
    /// </summary>
    /// <param name="times"></param>
    void train(int times)
    {
        for (int i = 0; i < (int)(times/3); i++)
        {
            // Give a random cross drawing as input
            neuralNetwork.feedForward(pattern(testDrawing[0][UnityEngine.Random.Range(0, testDrawing[0].Length-1)]));
            neuralNetwork.backProp(new float[] { 1, -1, -1 }); // Send the correct answer for backpropagation

            // Give a random circle drawing as input
            neuralNetwork.feedForward(pattern(testDrawing[1][UnityEngine.Random.Range(0, testDrawing[1].Length - 1)]));
            neuralNetwork.backProp(new float[] { -1, 1, -1 }); // Send the correct answer for backpropagation

            // Give a random triangle drawing as input
            neuralNetwork.feedForward(pattern(testDrawing[2][UnityEngine.Random.Range(0, testDrawing[2].Length - 1)]));
            neuralNetwork.backProp(new float[] { -1, -1, 1 }); // Send the correct answer for backpropagation
        }
        onPlay = true; // Active the drawing 
    }


    /// <summary>
    /// Unactive the drawing function, get the drawing as an array of black&white pixel, save it for next trainings and send the correct answer for backpropagation
    /// </summary>
    public void Finished()
    {
        onPlay = false;

        // Get back every pixel grayscale
        float[] draw = new float[1024];
        int pixel = 0;
        for (int x = 0; x < 32; x++)
        {
            for (int y = 0; y < 32; y++)
            {
                draw[pixel] = drawing.GetPixel(x, y).grayscale;
                pixel++;
            }
        }

        save(draw); // Add this drawing as a training exemple and save the test drawing sample

        // Take the neural newtork feedforward's output and send him the correct answer for backpropagation
        float[] outputs = neuralNetwork.feedForward(pattern(draw));
        float[] expected = new float[] { -1, -1, -1 };
        expected[drawID] = 1;
        neuralNetwork.backProp(expected);

        // Check which answer gave the neural network
        int max = 0;
        if (outputs[0] > outputs[1]) { max = 0; } else { max = 1; }
        if (outputs[2] > outputs[max]) { max = 2; }

        // Display is answer with his certainty ratio
        int perc = (int)((outputs[max]+1)*50);
        if (max == 0) { guess.text = "A Cross, " + perc + "%"; } else if (max == 1) { guess.text = "A Circle, " + perc + "%"; } else { guess.text = "A Triangle, " + perc + "%"; }

        // Display his overall succes ratio
        if (drawID == max) { correctAns += 1; }
        totalAns += 1;
        ratio.text = correctAns + "/" + totalAns;
    }

    /// <summary>
    /// Find pattern in the 1024 inputs by packing pixels by chunk of 4 by 4, return which pattern is found with 5 different neurons for each chunks
    /// </summary>
    /// <param name="input"></param>
    /// <returns></returns>
    float[] pattern(float[] input)
    {
        float[] outIn = new float[320];
        // 32 pixels/line, we take part of 4x4 pixels, 16 parts in total
        for (int i = 0; i < 64; i++)
        {
            // Horizontal line
            if (input[i*4 + 0] > 0.8 && input[i * 4 + 1] > 0.8 && input[i * 4 + 2] > 0.8 && input[i * 4 + 3] > 0.8 && input[i * 4 + 32] > 0.8 && input[i * 4 + 33] > 0.8 && input[i * 4 + 34] > 0.8 && input[i * 4 + 35] > 0.8 && input[i * 4 + 128] < 0.8 && input[i * 4 + 129] < 0.8 && input[i * 4 + 130] < 0.8 && input[i * 4 + 131] < 0.8)
            {
                outIn[i*5] = 1;
            }
            else
            {
                outIn[i*5] = -1;
            }
            // Vertical line
            if (input[i * 4 + 0] > 0.8 && input[i * 4 + 1] > 0.8 && input[i * 4 + 3] < 0.8 && input[i * 4 + 32] > 0.8 && input[i * 4 + 33] > 0.8 && input[i * 4 + 35] < 0.8 && input[i * 4 + 64] > 0.8 && input[i * 4 + 65] > 0.8 && input[i * 4 + 67] < 0.8 && input[i * 4 + 128] > 0.8 && input[i * 4 + 129] > 0.8 && input[i * 4 + 131] < 0.8)
            {
                outIn[i*5+1] = 1;
            }
            else
            {
                outIn[i*5+1] = -1;
            }
            // Diagonal right line
            if (input[i * 4 + 1] > 0.8 && input[i * 4 + 2] > 0.8 && input[i * 4 + 3] > 0.8 && input[i * 4 + 34] > 0.8 && input[i * 4 + 35] > 0.8 && input[i * 4 + 64] < 0.8 && input[i * 4 + 128] < 0.8 && input[i * 4 + 129] < 0.8 && input[i * 4 + 67] > 0.8)
            {
                outIn[i * 5 + 2] = 1;
            }
            else
            {
                outIn[i * 5 + 2] = -1;
            }
            // Diagonal left line
            if (input[i * 4 + 0] > 0.8 && input[i * 4 + 1] > 0.8 && input[i * 4 + 2] > 0.8 && input[i * 4 + 32] > 0.8 && input[i * 4 + 33] > 0.8 && input[i * 4 + 64] > 0.8 && input[i * 4 + 131] < 0.8 && input[i * 4 + 130] < 0.8 && input[i * 4 + 67] < 0.8)
            {
                outIn[i * 5 + 3] = 1;
            }
            else
            {
                outIn[i * 5 + 3] = -1;
            }
            // Full
            if (input[i * 4 + 33] > 0.9 && input[i * 4 + 34] > 0.9 && input[i * 4 + 65] > 0.9 && input[i * 4 + 66] > 0.9 && input[i * 4 + 35] > 0.8 && ((input[i * 4 + 0] > 0.8 && input[i * 4 + 131] > 0.8)|| (input[i * 4 + 3] > 0.8 && input[i * 4 + 128] > 0.8)))
            {
                outIn[i * 5 + 4] = 1;
            }
            else
            {
                outIn[i * 5 + 4] = -1;
            }
        }
        return outIn;
    }

    /// <summary>
    /// Save the test drawing samples
    /// </summary>
    /// <param name="newTest"></param>
    void save(float[] newTest)
    {
        if (Application.isEditor)
        {
            BinaryFormatter bf = new BinaryFormatter();
            FileStream file = File.Create(Application.persistentDataPath + "/DAIG.dat");
            learningSet data = new learningSet();

            // Add the new drawing to the training exemple list and replace an old one if more than 100
            float[][][] newT = new float[3][][];
            if (testDrawing[drawID].Length < 100)
            {
                if (drawID == 0)
                {
                    newT[0] = new float[testDrawing[0].Length + 1][];
                    for (int i = 0; i < testDrawing[0].Length; i++)
                    {
                        newT[0][i] = testDrawing[0][i];
                    }
                    newT[1] = testDrawing[1];
                    newT[2] = testDrawing[2];
                }
                else if (drawID == 1)
                {
                    newT[0] = testDrawing[0];
                    newT[1] = new float[testDrawing[1].Length + 1][];
                    for (int i = 0; i < testDrawing[1].Length; i++)
                    {
                        newT[1][i] = testDrawing[1][i];
                    }
                    newT[2] = testDrawing[2];
                }
                else
                {
                    newT[0] = testDrawing[0];
                    newT[1] = testDrawing[1];
                    newT[2] = new float[testDrawing[2].Length + 1][];
                    for (int i = 0; i < testDrawing[2].Length; i++)
                    {
                        newT[2][i] = testDrawing[2][i];
                    }
                }
                newT[drawID][newT[drawID].Length - 1] = newTest;
            }
            else
            {
                newT[0] = testDrawing[0];
                newT[1] = testDrawing[1];
                newT[2] = testDrawing[2];
                newT[drawID][UnityEngine.Random.Range(0, 100)] = newTest;
            }
            testDrawing = newT;

            // Save the training exemple list and neural network state
            data.testDrawing = newT;

            bf.Serialize(file, data);
            file.Close();
        } // Only save if inside the editor, so if someone on internet draw shit it doesn't decalibrate
    }

    /// <summary>
    /// Return to the menu
    /// </summary>
    public void menu()
    {
        SceneManager.LoadScene(0);
    }
